import React from "react";
import addCardButton from "../images/Vector.svg";
import editAvatar from "../images/profile-avatar-edit.svg";



function Main(props) {
  return (
    <main className="content">
      <section className="profile">
        <div className="profile__info">
          <div className="profile__avatar-container">
            <img className="profile__avatar" src={avatar} alt="Фотография профиля" />
            <button type="button" className="profile__avatar-button" onClick={props.onEditAvatar} />
          </div>
          <div className="profile__data">
            <h1 className="profile__name">{name}</h1>
            <button type="button" className="profile__edit-button" onClick={props.onEditProfile} />
            <p className="profile__description">{about}</p>
          </div>
        </div>
        <button type="button" className="profile__add-button" onClick={props.onAddPlace} />
      </section>

      <section className="elements">
        {cards.map(card => (
          <Card key={card._id} card={card} onCardClick={props.onCardClick} />
        ))}
      </section>
    </main>
  );
}



export default Main
